    <div style="background: linear-gradient(to bottom, #ab4c4d 0%, transparent 100%);height: 60%;width: 100%;border-radius: 10px;display: flex;flex-direction: column;align-items: center;justify-content: flex-start;overflow: hidden;">
      <img src="../../assets/error.png" style="width: 50%;height: 80%; margin-top: 40px;"/>
